  source:
    id: LocalizedStringKey
    path: D:\Projects\apps\Remora\documentation\src\Remora.Discord\Backend\Remora.Discord.Caching.Abstractions\CacheKey.cs
    startLine: 96
  assemblies:
  - Remora.Discord.Caching.Abstractions
  namespace: Remora.Discord.Caching.Abstractions
  summary: >-
    Creates a string-based cache key from a context string and key string. The context of a key can be, for

    instance, a GUID or the name of the application domain that manages this key. Therefore, two keys with the same

    <code class="paramref">keyString</code> can be functionally distinct by belonging to different contexts.
  remarks: >-
    <code class="paramref">context</code> should not contain <code>:</code> (colon symbol) as this can make the separation between

    context and key string ambiguous.
  example: []
  syntax:
    content: public static CacheKey LocalizedStringKey(string context, string keyString)
    parameters:
    - id: context
      type: System.String
      description: The key context.
    - id: keyString
      type: System.String
      description: The key string.
    return:
      type: Remora.Discord.Caching.Abstractions.CacheKey
      description: >-
        A new string-based cache key. This key is equal to other keys created by this method as long as

        <code class="paramref">context</code> and <code class="paramref">keyString</code> are the same.
    content.vb: Public Shared Function LocalizedStringKey(context As String, keyString As String) As CacheKey
  overload: Remora.Discord.Caching.Abstractions.CacheKey.LocalizedStringKey*
  nameWithType.vb: CacheKey.LocalizedStringKey(String, String)
  fullName.vb: Remora.Discord.Caching.Abstractions.CacheKey.LocalizedStringKey(String, String)
